import EventCard from "../comps/eventCard";
import Grid from "@material-ui/core/Grid";

function Timeline(props) {
    const style = {
        color: "white",
        fontSize: 8,
        lineHeight: 4
    };

    const style2 = {
        overflowY: "scroll",
        maxheight: 700
    };

    function fillEvents(events) {
        var time = 0;
        var filledEvents = [];
        events.map(event => {
            if (time < event.startTime) {
                filledEvents.push({
                    startTime: time,
                    endTime: event.startTime
                });
                filledEvents.push(event);
                time = event.endTime;
            } else {
                filledEvents.push(event);
                time = event.endTime;
            }
        });
        return filledEvents;
    }

    return fillEvents(props.events).map(event => (
        <Grid container spacing={1}>
            <Grid item xs={1}>
                <p style={style}>
                    {parseInt(event.startTime / 60)} : {event.startTime % 60}
                </p>
            </Grid>
            <Grid item xs={11}>
                <EventCard event={event} />
            </Grid>
        </Grid>
    ));
}

export default Timeline;
